import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="flex flex-col min-h-screen">
      <Header />

      {/* Main Content */}
      <main className="flex-grow bg-gray-100 p-8">
        <h1 className="text-4xl font-bold text-center">Welcome to Your Website</h1>
        <p className="text-center text-lg mt-4">Your content goes here.</p>
      </main>

      <Footer />
    </div>
  );
}

export default App;
